const wchar_t* PartitionManager::GetStringFromPartitionTypeGUID(GUID guid)
{
	for (int i = 0; GptTypes[i].display_name; i++)
		if (!memcmp(&GptTypes[i].guid, &guid, sizeof(GUID)))
			return GptTypes[i].display_name;
	return L"Unknown type";
}
const wchar_t* PartitionManager::GetStringFromPartitionSystemID(char systemID)
{
	for (int i = 0; GptTypes[i].display_name; i++)
		if (((char)(GptTypes[i].gDiskType >> 8)) == systemID)
			return GptTypes[i].display_name;
	return L"Unknown type";
}
const wchar_t* PartitionManager::GetStringFromPartitionTypeCode(short typeCode)
{
	for (int i = 0; GptTypes[i].display_name; i++)
		if (GptTypes[i].gDiskType == typeCode)
			return GptTypes[i].display_name;
	return L"Unknown type";
}
const GUID* PartitionManager::GetGUIDFromPartitionTypeCode(short typeCode)
{
	for (int i = 0; GptTypes[i].display_name; i++)
		if (GptTypes[i].gDiskType == typeCode)
			return &GptTypes[i].guid;
	return &GptTypes[0].guid;
}